import React from 'react';

function BarPlot({ imageUrl }) {
  return (
    <div>
      <h3>Bar Plot</h3>
      <img src={imageUrl} alt="Bar Plot" style={{ width: '400px', height: '300px' }} />
    </div>
  );
}

export default BarPlot;
